commit.message:
try Agrona hashtable for orderId->Order (improves theoretical worst latency 30us->6us);
introduce objects pools for orders (1M records) and buckets (64K records), ART doesn't use pools yet;
try to reuse price bucket when moving order (for sparse order books);

fix unmerged direct order book functionality (bucket orders);
increase number of symbols to 100K in multi-symbol tests;
change random seed between persistence test iterations;
update README.md.
